Making the UIStart a new file and call it PersonEditor.tsx, so we can use JSX in our TypeScript. We'll need to import React of course, and our Person model. We'll also use a component from immuto-react called TextInput:import * as React from "react";
import { Person } from "./Person";
import { TextInput } from "immuto-react";
In Immuto all the model data is passed in through props, so let's declare the type of our props in TypeScript. There's that mysterious Cursor type we declared in the previous step:export interface PersonEditorProps {
    binding: Person.Cursor;    
}
Now we can declare our stateless component for editing a Person. We use destructuring to get the binding prop into a simple named variable:export const PersonEditor = ({binding}: PersonEditorProps) => (


            First name




            Last name




            {binding.state.firstName} {binding.state.lastName}


);
Save this. One last thing we need to do is change index.tsx, which currently renders Hello, world!. So open it up and replace the content with:import { bindToStore } from "immuto-react";
import { Person } from "./Person";
import { PersonEditor } from "./PersonEditor";
Under the imports, add the following:const store = Person.reduce.store();

const App = bindToStore(store, root => );
The first line creates a store to hold the current state of our Person. Behind the scenes it calls the createStore function from Redux, but this way it's given more strict static typing.The second line creates a new component App that requires no props, and which renders PersonEditor using the current content of the store. This means it re-renders whenever the store changes.Finally, fix the call to ReactDOM.render so it uses the new App component:ReactDOM.render((



), document.querySelector("#root"));
Save this too. Rebuild everything:$ webpack
Now open index.html in your browser and have fun entering your own name, or that of a celebrity. The possibilities are limited!
